import React from 'react';
import {BrowserRouter as Routes, Route} from 'react-router-dom'
import './App.css';

function Home(){
  return(
    <div>home</div>
  )
}
function About(){
  return(
    <div>About</div>
  )
}
function App() {
  return (
    <div className="App">
      <h1>Welcome to React Router!</h1>
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route path="about" element={<About />} />
      </Routes>
    </div>
    //router
    //  navbar
    //  div for content
    //    switch
    //      route
    //      rout
  );
}

export default App;
